class FollowCamera extends MonoBehaviour {

  public static startPos: Vector3;
  public static startRot: Quaternion;

  @SerializeField
  moveSpeed: number = 1;

  @SerializeField
  fadeSpeed = 0.01;

  @SerializeField
  rotateSpeed: number = 1;

  @SerializeField
  zoomSpeed: number = 1;

  @SerializeField
  minZoom: number = -12;

  @SerializeField
  maxZoom: number = -2.5;

  mouseX: number = 0;
  mouseY: number = 0;

  onCamRender: BABYLON.Observer<any>;
  onMouseMove: BABYLON.Observer<any>;

  zoomTarget: number = 0;
  zoomValue: number = 0;

  justFinishedFade: boolean = true;

  camBounds: BoxCollider;

  cam : Camera;

  Lerp(v1: number, v2: number, value: number): number {
    return Mathf.Clamp(this.LerpUnclamped(v1, v2, value), v1, v2);
  }

  LerpUnclamped(v1: number, v2: number, value: number): number {

    return v1 + ((v2 - v1) * value);
  }

  Awake() {
    if (FollowCamera.startPos) {
      this.transform.localPosition = FollowCamera.startPos;
      this.transform.localRotation = FollowCamera.startRot;
      this.justFinishedFade = false;
      let v = new Vector3();
    } else {
      //We move the camera out of the screen so when the first models load, this is not done in front of the camera
      //It would be nice if loaded models didn't appear right when the get loaded.
      FollowCamera.startPos = this.transform.localPosition.clone();
      FollowCamera.startRot = this.transform.localRotation.clone();
      this.transform.localPosition = new Vector3(1000, 0, 0);

    }
    this.cam = this.GetComponent(Camera);
    this.cam.bCam.minZ = 0.01;
    this.cam.bCam.maxZ = 100;
    this.cam.bCam.fov = 1;
  }

  //Start is called before the first frame update
  Start() {
    this.camBounds = GameObject.Find("CameraBounds").GetComponent(BoxCollider);

    // this.zoomTarget = this.transform.localPosition.z;
    // this.zoomValue = this.zoomTarget;

    this.onMouseMove = Engine.scene.onPointerObservable.add(pointer => {
      var evt = pointer.event as WheelEvent;
      //  this.zoomTarget -= evt.deltaY * this.zoomSpeed;
      // this.zoomTarget = Mathf.Clamp(this.zoomTarget, this.minZoom, this.maxZoom);
      this.transform.Translate(0, 0, -evt.deltaY * this.zoomSpeed, BABYLON.Space.LOCAL);

    }, BABYLON.PointerEventTypes.POINTERWHEEL, false);

  }

  //Update is called once per frame
  Update() {
    if (!MainGame.fadeInFinished)
      return;

    //This should only happen at the start after fade has finished
    //I should use an event!
    if (this.justFinishedFade) {
      this.justFinishedFade = false;
      this.transform.localPosition = FollowCamera.startPos.clone();
      this.transform.localRotation = FollowCamera.startRot.clone();
    }

    this.mouseX = this.LerpUnclamped(this.mouseX, Input.GetAxis("Mouse X") * this.rotateSpeed, this.fadeSpeed);
    this.mouseY = this.LerpUnclamped(this.mouseY, Input.GetAxis("Mouse Y") * this.rotateSpeed, this.fadeSpeed);


    if (Input.GetMouseButton(0)) {

      if (!ENABLE_EDITOR) {
        Cursor.lockState = CursorLockMode.Locked;
      }
      this.transform.Rotate(this.mouseY, 0, 0, BABYLON.Space.LOCAL);
      this.transform.Rotate(0, this.mouseX, 0, BABYLON.Space.WORLD);



    } else {
      if (!ENABLE_EDITOR) {
        Cursor.lockState = CursorLockMode.None;
      }
    }

    FollowCamera.startPos = this.transform.localPosition.clone();
    FollowCamera.startRot = this.transform.localRotation.clone();

    //  this.transform.transformNode.lookAt(Robot.main.transform.transformNode.position);
    var hor = Input.GetAxis("Horizontal");
    var ver = Input.GetAxis("Vertical");

    this.transform.Translate(hor * this.moveSpeed, 0, ver * this.moveSpeed, BABYLON.Space.LOCAL);

    this.ClampToBounds();
  }

  LateUpdate() {
    //For some reason this has to be in the LateUpdate not regular update..? 

  }

  ClampToBounds() {
    let pos = new Vector3();

    let min = this.camBounds.bounds.minimum.clone();
    let max = this.camBounds.bounds.maximum.clone();
    //BOunds are local so need the transform position
    //Only adding y since x and z are 0.
    min.y += this.camBounds.transform.position.y;
    max.y += this.camBounds.transform.position.y;

    pos.x = Mathf.Clamp(this.transform.position.x, min.x, max.x);
    pos.y = Mathf.Clamp(this.transform.position.y, min.y, max.y);
    pos.z = Mathf.Clamp(this.transform.position.z, min.z, max.z);

    this.transform.position = pos;
  }



  OnDestroy() {
    Engine.scene.onPointerObservable.remove(this.onMouseMove);
  }

}

