class CameraFadeInFadeOut extends MonoBehaviour {


  //Tweakables
  @SerializeField
  logoDuration: number = 0.5;

  @SerializeField
  fadeDuration: number = 0.5;

  public static loadLogo: boolean = true;

  public isLightUp: boolean = false;

  private light : Light;
  private env : HDREnvironment;
  private timer: number = 0;

  private logo: CustomImage;
  private background : CustomImage;

  private lightIntensity : number = 0.3;
  private dirLightIntensity : number = 1;

  private renderers : Renderer[];
  private meshesLoaded = false;

  Awake() {

    //Only when refreshing should the logo be shown
    if (CameraFadeInFadeOut.loadLogo) {

      CameraFadeInFadeOut.loadLogo = false;
      this.background = Instantiate(CustomImage).Init("black_pixels.jpg", 5000, 5000);
      this.background.image.alpha = 1;    
      this.logo = Instantiate(CustomImage).Init("FirstRoboticsCanada.jpg", 327, 255);
      this.logo.image.alpha = 1;
      Engine.scene.clearColor = new BABYLON.Color4(0,0,0,0);
    }
    else {
      Destroy(this);
      //Setting the background to gray so there appears to be a ceiling
      Engine.scene.clearColor = new BABYLON.Color4(0.7,0.7,0.7,1);
    }
  }

  Start ()
  {
    this.renderers = GameObject.FindObjectsOfType(Renderer);
  }

  IsLoadingMeshes () : boolean
  {
    for (let i = 0; i < this.renderers.length; i++ )
    {
      if (this.renderers[i].isLoadingMesh)
      {
        return true;
      }
    }
    return false;
  }

  Update() {
    //Check if meshes are loaded.
    if (!this.meshesLoaded)
    {
      this.meshesLoaded = !this.IsLoadingMeshes();
    }
    if (this.timer >= this.logoDuration) {
      if (this.meshesLoaded) {
        this.DestroyLogo();
        //Setting the background to gray so there appears to be a ceiling
        Engine.scene.clearColor = new BABYLON.Color4(0.7,0.7,0.7,1);

        if (this.light)
        {
          this.light.intensity = this.lightIntensity;
        }
        MainGame.fadeInFinished = true;
        this.background.image.alpha -= 0.01 / this.fadeDuration;
        if (this.background.image.alpha <= 0)
        {
          Destroy(this.background)
          Destroy(this);
        }
      }
    } else {
      this.timer += Time.deltaTime;
    }
  }

  FadeOut () 
  {

  }

  FadeIn ()
  {

  }

  DestroyLogo() {
    if (this.logo) {
      Destroy(this.logo.gameObject);
      this.logo = null;
    }
  }

}

