class VictoryTrigger extends MonoBehaviour
{
  inVictoryArea: boolean = false;
  isVictory: boolean = false;  

  Start()
  {
    this.transform.SetParent(null, true);

  }

  FixedUpdate(){
    if(this.inVictoryArea){
      if(!this.isVictory){
        if(!Robot.main.IsMoving()){
          MainGame.instance.OnVictory();
          this.isVictory = true;
        }        
      }
    }
  }

  OnTriggerEnter(other : Collider)
  {
    if (other.GetComponent(Robot))
    {
        this.inVictoryArea = true;
    }

  }

  OnTriggerExit(other : Collider)
  {
    if (other.GetComponent(Robot))
    {
      this.inVictoryArea = false;
    }
  }
}

