@ExecuteInEditMode
class Wall extends MonoBehaviour {

  @SerializeField
  width: number = 1;

  sideWalls: Transform[] = new Array();
  centerWalls: Transform[] = new Array();


  //Start is called before the first frame update
  Start() {
    this.GetComponentsInChildren(Renderer).forEach(r => {
      if (r.name == "SideWall") {
        this.sideWalls.push(r.transform);
      } else if (r.name == "WallBase" || r.name == "Window") {
        //We have to fix parented collider-bug by unparenting at the start.
        if (Engine.isPlaying) {
        //  r.transform.SetParent(null);
        }
        this.centerWalls.push(r.transform);
      }
    })
    this.UpdateWalls();
  }

  //Update is called once per frame
  Update() {
    if (!Engine.isPlaying) {
      this.UpdateWalls();
    }
  }

  UpdateWalls() {
    this.sideWalls[0].transform.localPosition.x = -this.width * 0.5;
    this.sideWalls[1].transform.localPosition.x = this.width * 0.5;
    this.centerWalls.forEach(w => {
      w.localScale.x = this.width;
    });
  }
}

