class LaserWall extends Wall {

  static container: Record<number, LaserWall[]> = {};

  @SerializeField
  id: number = 0;

  @SerializeField
  isRed: boolean = true;

  Awake() {
    if (!LaserWall.container[this.id]) {
      LaserWall.container[this.id] = new Array();
    }
    LaserWall.container[this.id].push(this)
  }

  Start() {
    super.Start();

    this.centerWalls.forEach(w => {
      w.renderer.materialName = this.isRed ? "laser_red.mat" : "laser_blue.mat";
    });
  }

  Disable() {
    this.centerWalls.forEach(w => {
      Destroy(w.gameObject);
    });

    this.centerWalls = new Array();
  }

}

