@ExecuteInEditMode
class RotatingWall extends Wall {

  pillar: Transform;

  doorMoveSpeed = 50;

  @SerializeField
  startRotation: number = 0;

  @SerializeField
  endRotation: number = 0;

  @SerializeField
  endRotation2: number = 0;

  currRotation: number = 0;

  starts: BABYLON.Quaternion[] = new Array();
  rotators: Transform[] = new Array();

  direction: boolean = false;

  //Start is called before the first frame update
  Start() {
    this.pillar = this.transform.Find("Pillar").transform;
    this.direction = Random.value < 0.5;

    super.Start();
    if (Engine.isPlaying) {
      this.sideWalls.forEach(w => {
        w.SetParent(this.pillar, true);
      })
      this.centerWalls.forEach(w => {
        w.SetParent(this.pillar, true);
      });
    }

    this.currRotation = this.startRotation;
  }

  //Update is called once per frame
  Update() {
    super.Update();
    if (Engine.isPlaying) {
      if (MainGame.instance.isRunning) {
        this.currRotation = Mathf.MoveTowards(this.currRotation,
          this.direction ? this.endRotation2 : this.endRotation,
          Time.deltaTime * this.doorMoveSpeed);
      }
    } else {
      this.currRotation = this.startRotation;
    }

    this.RotateAroundPillar();
  }

  RotateAroundPillar() {

    this.pillar.localRotation = Quaternion.Euler(0, this.currRotation, 0);
  }

  UpdateWalls() {
    super.UpdateWalls();
    this.pillar.transform.localPosition.x = this.width * -0.5;
  }
}

