class ColorTag extends MonoBehaviour {

  @SerializeField
  wallId: number;

  fadeTime = 3;

  fadeValue: number = 0;
  maxFadeValue: number = 5;

  private color: BABYLON.Color3;

  private r: Renderer;

  private isRed: boolean = false;

  Start() {
    this.r = this.GetComponentInChildren(Collider).GetComponent(Renderer);
    this.isRed = Random.value < 0.5;
    if (this.isRed) {
      this.r.materialName = "sensor_color_red.mat";
      this.color = new BABYLON.Color3(0.9, 0, 0.1);//Red - B has a value so HSV has a high value (as opposed to 0)
      Debug.Log(this.color.toHSV().r);

    } else {

      this.r.materialName = "sensor_color_blue.mat";
      this.color = this.color = new BABYLON.Color3(0.01, 0.01, 0.9);//Blue
    }
    this.fadeValue = 0;

    MainGame.onRun.add(e => {
      this.DisableLaserWalls();
    })

  }

  FixedUpdate() {
    if (MainGame.instance.isRunning) {
      this.fadeValue += (Time.deltaTime / this.fadeTime) * this.maxFadeValue;
    }
    if (this.fadeValue <= this.maxFadeValue) {
      this.r.material.specularPower = this.fadeValue;
    }
  }

  OnColorDetected ()
  {
    //
  }

  DisableLaserWalls() {
    LaserWall.container[this.wallId]?.forEach(wall => {
      if (wall.isRed != this.isRed) {
        wall.Disable();
      }
    });
  }

  public GetColor(): BABYLON.Color3 {
    return this.color;
  }

}

