@ExecuteInEditMode
class Floor extends MonoBehaviour {

    mat: Material;

    multiplier = 0.3;

    Start() {
        this.mat = Material.Get("MatArea.mat").Clone();

        this.renderer.SetMaterial(this.mat);

        this.mat.uScale = this.transform.localScale.z * this.multiplier;
        this.mat.vScale = this.transform.localScale.x * this.multiplier;
        this.mat.uOffset = (this.transform.localPosition.z) * this.multiplier - this.mat.uScale * 0.5 + 0.5;
        this.mat.vOffset = (-this.transform.localPosition.x) * this.multiplier- this.mat.vScale * 0.5 + 0.5;
    }

    OnDestroy() {
        this.mat.Destroy();
    }

}

