abstract class Move {
  // public static current: Move;

  protected moveList : RobotMoveList;

  constructor (moveList : RobotMoveList)
  {
    this.moveList = moveList;
  }

  // public get robot(): Robot {
  //   return Robot.main;
  // }

  async Run() {
    this.moveList.current = this;
    return await new Promise(resolve => {
      var func = () => {
        //I'm 99% sure this is a memory leak but let's just assume it's tiny
        //Since we can't cancel async methods, we have to pause old moves instead
        //When we reload the scene, we also set the Move.current to null
        if (this.moveList.current == this) {
          this.Update();

          if (this.IsCompleted()) {
            this.OnDestroy();
            Engine.scene.onBeforeStepObservable.removeCallback(func);
            resolve(this.GetReturnValue());
          }
        }
        else {
          //Move event listener is removed and the move will never complete
          //The move is now destined to wonder our memory forever- never to be accessed. Poor move.
          Engine.scene.onBeforeStepObservable.removeCallback(func);

        }
      }
      Engine.scene.onBeforeStepObservable.add(func);
      if (this.DoesRunInstant()) {
        func();
      }
    });
  }

  DoesRunInstant(): boolean {
    return true;
  }

  OnDestroy(): void {

  }

  Update(): void {

  }

  //By default all moves complete instantly.
  IsCompleted(): boolean {
    return true;
  }

  GetReturnValue(): any {
    return null;
  }
}


class MovementMove extends Move {
  public speed: number = 0.01;
  public distance: number;

  constructor(moveList: RobotMoveList,distance: number = 1) {
    super(moveList);
    this.distance = distance;
  }

  IsCompleted() {
    return this.distance <= 0;
  }

  Update() {

    this.distance -= this.speed;
  }

  OnDestroy() {
