//RunOpMode returns true, but it waits one frame before it does so
//This way, it can be used in a while loop to make it into a 'tick'
class OpModeIsActiveObj extends Move {

  private framesPassed : number = 0;

  Update ()
  {
    this.framesPassed++;
  }

  IsCompleted ()
  {
    //We check the second frame because Update is actually called once when the move is created
    return this.framesPassed >= 2;
  }

  //Currrently it's always true - should be only for 30 seconds?
  GetReturnValue ()
  {
    return MainGame.instance?.isRunning;
  }
}

async function OpModeIsActive (robot)
{
  return new OpModeIsActiveObj(robot).Run();
}

