@RegisterAsComponent
class RobotMotor extends MonoBehaviour {

  @SerializeField
  private motorName: string = "";

  public currentSpeed: number = 0;

  private direction: MotorDirectionEnum = MotorDirectionEnum.FORWARD;
  private mode: MotorModeEnum = MotorModeEnum.RUN_USING_ENCODER;
  public isEnabled: boolean = true;
  // Use only in RUNT_USING_ENCODER mode
  private power: number = 0;
  // Use only in TO_POSITION mode
  private tickPosition: number = 0;
  private tickDestination: number = 0;

  public speed: number = 1;

  public SetPower(power: number) {
    this.power = power;
  }

  public GetPower() {
    return this.power;
  }

  public SetDirection(direction: MotorDirectionEnum) {
    this.direction = direction;
  }

  public GetDirection() {
    return this.direction;
  }

  public GetName() {
    return this.motorName;
  }

  public ResetEncoder() {
    this.tickPosition = 0;
  }

  public SetMode(mode: MotorModeEnum) {
    if (mode == MotorModeEnum.STOP_AND_RESET_ENCODER) {
      this.tickPosition = 0;
      return;
    }
    this.mode = mode;
  }

  public GetMode() {
    return this.mode;
  }

  public MoveToTickDestination(step: number) {
    this.tickPosition = Mathf.MoveTowards(this.tickPosition, this.tickDestination, step);
  }

  public AddTickPosition(tick: number = 1) {
    this.tickPosition += tick;
  }

  public GetTickPosition() {
    return this.tickPosition;
  }

  public SetTickDestination(tickDestination: number) {
    this.tickDestination = tickDestination;
  }

  public GetTickDestination() {
    return this.tickDestination;
  }

  public IsWorking(): boolean {
    if (this.mode == MotorModeEnum.RUN_TO_POSITION) {
      // return true meaning when tickPosition != tickDestination,
      // meaning motor is working
      return !(this.tickPosition == this.tickDestination);
    } else {
      // return true when the power is not equal 0, meaning motor is 
      // working
      return this.power !== 0;
    }
  }

  FixedUpdate ()
  {
    this.CalculateMotorMovement();
  }

  private CalculateMotorMovement() {

    let tickStep = this.speed * 3;

    let result = 0;

    // create result object to return 
    let pow = Math.abs(this.GetPower()) >= 1 ? Math.sign(this.GetPower()) : this.GetPower();
    result = pow * this.speed;

    // if running in RUN_TO_POSITION mode, tickPosition is required
    if (this.GetMode() == MotorModeEnum.RUN_TO_POSITION) {
      //We calculate the tickstep needed
      //The tickstep is less if we are close to the end
      var distanceToDestination = this.GetTickDestination() - this.GetTickPosition();
      //To remember if it's positive or negative
      let mp = Math.sign(distanceToDestination);
      let tickStepNeeded = Mathf.Min(tickStep, Math.abs(distanceToDestination)) * mp;
      //Based on the tickStepNeeded, we update the direction and rotation
      result = (tickStepNeeded / tickStep);

      this.MoveToTickDestination(tickStep);
    }
    // reverse both direction and rotation if the motor is in reverse mode
    if (this.GetDirection() == MotorDirectionEnum.REVERSE) {
      result *= -1;
    }

    this.currentSpeed = result;
  }
}

enum MotorDirectionEnum {
  FORWARD = "FORWARD",
  REVERSE = "REVERSE"
}

enum MotorModeEnum {
  RUN_USING_ENCODER = "RUN_USING_ENCODER",
  RUN_TO_POSITION = "RUN_TO_POSITION",
  STOP_AND_RESET_ENCODER = "STOP_AND_RESET_ENCODER"
}

