class RobotServo extends MonoBehaviour {

  @SerializeField
  private servoName: string = "";

  private position: number = 0;
  private target: number;
  private direction: MotorDirectionEnum;
  public isEnabled: boolean = true;
  public minPos: number = 0;
  public maxPos: number = 1;
  // the speed of changing position
  speed: number = 0.01;

  public currentSpeed: number = 0;

  public SetName(name: string){
    this.servoName = name;
  }

  public GetName(){
    return this.servoName;
  }

  public SetPosition(position: number){
    this.position = position;
  }

  public GetPosition(){
    return this.position;
  }

  public SetTarget(target: number){
    this.target = Mathf.Clamp(target,this.minPos, this.maxPos);
  }

  public GetTarget(){
    return this.target;
  }

  public SetDirection(direction: MotorDirectionEnum){
    this.direction = direction
  }

  public GetDirection(){
    return this.direction;
  }

  public AddPosition(pos: number){
    this.position += pos;
  }
  // Use to calculate the final eulerangles
  public GetRotation(){
    return this.position * 180;
  }

  public SetServoScaleRange(min: number, max: number){
    if(min > max) return;
    this.minPos = Mathf.Clamp(min, 0, 1);
    this.maxPos = Mathf.Clamp(max, 0, 1);
  }

  public FixedUpdate(){

    if(Math.abs(this.position - this.target) < this.speed){
      this.currentSpeed = 0;
    } else if(this.position < this.target){
      this.currentSpeed = this.speed;
    }else if(this.position > this.target){
      this.currentSpeed = -this.speed;
    } 

    this.position += this.currentSpeed;
  }

}

