class Beatle extends Robot {

  //multipliers to make the movement 'realistic'

  moveSpeed = 300;
  rotateSpeed = 158;

  leftMotor: RobotMotor;
  rightMotor: RobotMotor;

  servo1: RobotServo;
  servo2: RobotServo;

  mp = 0.05;

  Awake() {
    super.Awake();
    this.leftMotor = this.GetMotor("motorLeft");
    this.rightMotor = this.GetMotor("motorRight");

  }

  MotorMovement() {
    let rb = this.gameObject.GetComponent(Rigidbody);

    //Rotation
    let motorLeftMove = this.leftMotor.currentSpeed;
    let motorRightMove = this.rightMotor.currentSpeed;
    //let rotateDelta = (motorLeftMove * this.rotateSpeed * Time.fixedTimeStep + motorRightMove * this.rotateSpeed * Time.fixedTimeStep);
    let rotateDelta = (motorLeftMove * this.rotateSpeed * this.mp + motorRightMove * this.rotateSpeed * this.mp);

    //this.transform.localEulerAngles.y -= rotateDelta;
    rb.angularVelocity = new Vector3(0, -rotateDelta, 0);

    //Movement

    //We invert the motorLeftMove since it's rotated
    //We only do this AFTER the rotation because... math.
    motorLeftMove *= -1;
    let moveDelta = motorLeftMove * this.moveSpeed * this.mp + motorRightMove * this.moveSpeed * this.mp;

    let movingAngle = Math.floor(this.transform.localEulerAngles.y);


    //rb.angularVelocity = new Vector3(0, 0, 0);
    let vel = rb.velocity.clone();
    vel.x = Math.sin(movingAngle * Mathf.Deg2Rad) * moveDelta;
    vel.z = Math.cos(movingAngle * Mathf.Deg2Rad) * moveDelta;

    rb.velocity = vel;

    this.transform.localEulerAngles.x = 0;
    this.transform.localEulerAngles.z = 0;
  }

  EngineSensor() {
    this.colorSensor.DetectColor();
    this.distanceSensor.DetectDistance();
  }

  IsMoving() {
    return this.leftMotor.IsWorking() || this.rightMotor.IsWorking();
  }

}

