  }

  grabberUp = false;

  InputControlMovement() {

    this.driveLeft.SetPower(0);
    this.driveRight.SetPower(0);
    this.sideways.SetPower(0)

    if (Input.GetKey(KeyCode.T)) {
      this.driveLeft.SetPower(-1);
      this.driveRight.SetPower(1);
    }
    if (Input.GetKey(KeyCode.G)) {
      this.driveLeft.SetPower(1);
      this.driveRight.SetPower(-1);
    }

    if (Input.GetKey(KeyCode.F)) {
      this.driveLeft.SetPower(1);
      this.driveRight.SetPower(1);
    }

    if (Input.GetKey(KeyCode.H)) {
      this.driveLeft.SetPower(-1);
      this.driveRight.SetPower(-1);
    }

    if (Input.GetKeyDown(KeyCode.Space)) {
      if (this.grabberUp)
      {
        this.grabber.SetTarget(0);
      } else {
        this.grabber.SetTarget(1);
      }
      this.grabberUp = !this.grabberUp;
    }


    if (Input.GetKey(KeyCode.R)) {
      this.sideways.SetPower(-1)
    }
    if (Input.GetKey(KeyCode.Y)) {
      this.sideways.SetPower(1)
    }

    if (Input.GetKey(KeyCode.Enter)) {
      this.EngineSensor();
      consolelog(this.colorSensor.GetColor());
    }

  }

  MotorMovement() {
    let rb = this.gameObject.GetComponent(Rigidbody);

    //Rotation
    let motorLeftMove = this.driveLeft.currentSpeed;
    let motorRightMove = this.driveRight.currentSpeed;

    //let rotateDelta = (motorLeftMove * this.rotateSpeed * Time.fixedTimeStep + motorRightMove * this.rotateSpeed * Time.fixedTimeStep);
    let rotateDelta = (motorLeftMove * this.rotateSpeed * this.mp + motorRightMove * this.rotateSpeed * this.mp);

    //this.transform.localEulerAngles.y -= rotateDelta;
    rb.angularVelocity = new Vector3(0, -rotateDelta, 0);

    //Movement

    //We invert the motorLeftMove since it's rotated
    //We only do this AFTER the rotation because... math.
    motorLeftMove *= -1;
    let moveDelta = motorLeftMove * this.moveSpeed * this.mp + motorRightMove * this.moveSpeed * this.mp;

    //Moving sideways
    let motorSideMove = this.sideways.currentSpeed * this.moveSpeed * this.mp;

    let movingAngle = Math.floor(this.transform.localEulerAngles.y);



    //rb.angularVelocity = new Vector3(0, 0, 0);
    let vel = rb.velocity.clone();
    vel.x = (Math.sin(movingAngle * Mathf.Deg2Rad) * moveDelta) + (Math.sin((movingAngle + 90) * Mathf.Deg2Rad) * motorSideMove);
    vel.z = (Math.cos(movingAngle * Mathf.Deg2Rad) * moveDelta) + (Math.cos((movingAngle + 90) * Mathf.Deg2Rad) * motorSideMove);

    rb.velocity = vel;

    this.transform.localEulerAngles.x = 0;
    this.transform.localEulerAngles.z = 0;
  }

  EngineSensor() {
    this.colorSensor.GrabbyDetectColor();
  }

  IsMoving() {
    return this.driveLeft.IsWorking() || this.driveRight.IsWorking() || this.sideways.IsWorking();
  }

}

