    if (!this.isEnabled) {
      return new BABYLON.Color3(0, 0, 0);
    }
    return this.color;

  }

  public SetColor(color: BABYLON.Color3) {
    if (this.isEnabled) {
      this.color = color
    }
  }

  FixedUpdate ()
  {
    if(this.transform.GetComponentInParent(MrGrabby)){
      this.GrabbyDetectColor();
    }else{
      this.DetectColor();
    }
  }

  public DetectColor() {
    var origin = new BABYLON.Vector3();
    Vector3.VtoB(this.transform.position, origin);

    this.SetColor(new BABYLON.Color3(0.1, 0.1, 0.1)); //grey

    let ray = new BABYLON.Ray(origin, BABYLON.Vector3.Down(), 3);
    let hits = Engine.scene.multiPickWithRay(ray, null);
    hits.forEach(hit => {
      if (hit.pickedMesh) {
        let obj = Engine.meshToObject[hit.pickedMesh.parent?.uniqueId]
        if (obj) {
          let colTag = obj.GetComponentInParent(ColorTag)
          if (colTag) {
            colTag.OnColorDetected();
            if (!Utility.CompareColor(colTag.GetColor(), this.GetColor())) {
              let col = new BABYLON.Color3(colTag.GetColor().r, colTag.GetColor().g, colTag.GetColor().b)
              this.SetColor(col);
            }
          }
        }

      }
    });

  }

  public GrabbyDetectColor(){
    // grabby shots his ray forward instead of down
    var origin = new BABYLON.Vector3();
    let grabby = this.transform.GetComponentInParent(MrGrabby).transform
    Vector3.VtoB(new Vector3(grabby.position.x, grabby.position.y + 0.5, grabby.position.z), origin);

    this.SetColor(new BABYLON.Color3(0.1, 0.1, 0.1)); //grey

    var forward = new BABYLON.Vector3();
    Vector3.VtoB(grabby.forward, forward);

    let ray = new BABYLON.Ray(origin, forward , 3);
    let hits = Engine.scene.multiPickWithRay(ray, null);
    hits.forEach(hit => {
      if (hit.pickedMesh) {
        let obj = Engine.meshToObject[hit.pickedMesh.parent?.uniqueId]
        if (obj) {
          let button = obj.GetComponentInParent(GrabbyButton)
          if (button) {
            if (!Utility.CompareColor(button.sensorColor, this.GetColor())) {
              this.SetColor(button.sensorColor);
            }
          }
        }

      }
    });
  }


