class DistanceSensor extends RobotSensor{

  private distance: number = 500;

  private bOrigin: BABYLON.Vector3 = new BABYLON.Vector3();
  private forwardDirection: BABYLON.Vector3 = new BABYLON.Vector3(0, -1, 0);

  public GetDistance(){
    return this.distance;
  }

  public DetectDistance(){

    Vector3.VtoB(this.transform.position, this.bOrigin)
    this.forwardDirection = this.transform.transformNode.getDirection(new BABYLON.Vector3(0, 0, 1))
    this.forwardDirection.normalize();
    let ray = new BABYLON.Ray(this.bOrigin, this.forwardDirection, 100);
    let hit = Engine.scene.pickWithRay(ray)
    if (hit.distance > 0)
    {
      this.distance = hit.distance;
    } else {
      hit.distance = 500;
    }


  }

}

