  async Run ()
  {
      return await new Promise(resolve => 
      {
        var func = () => {
          this.Update();

          if (this.IsCompleted())
          {
            this.OnDestroy();
            Engine.scene.onBeforeStepObservable.removeCallback(func);
            resolve(this.GetReturnValue());
          }
      }
      Engine.scene.onBeforeStepObservable.add(func);
      if (this.DoesRunInstant())
      {
        func();
      }
    });
  }

  DoesRunInstant () : boolean
  {
    return true;
  }

  OnDestroy() : void
  {

  }

  Update() : void
  {

  }

  //By default all moves complete instantly.
  IsCompleted() : boolean
  {
    return true;
  }

  GetReturnValue () : any
  {
    return null;
  }
}

