class TelemetryGUI extends MonoBehaviour {

   public robot: Robot;
  private button: BABYLON.GUI.Button;
  private initiate: boolean = false;
  private enable: boolean = true;
  private textBlock: BABYLON.GUI.TextBlock;
  private container: BABYLON.GUI.Rectangle;
  private displayTxt: BABYLON.GUI.TextBlock;
  private containerHeight: number = 100;
  private containerWidth: number = 200;
  private pixelPerLine: number = 30;
  private fontSize: number = 12;
  private containerCurHeight: number;
  private buttonCurTop: number = 0;

  private renderCollection: { [id: string]: number} = {};


  Update() {

    if(!this.initiate){
      this.InitiateButton();
      this.initiate = true;
    }

    if(this.button && this.textBlock){
      this.textBlock.text = this.enable ?  'close' : 'open';
    }

    if(this.container){
      this.AdjustContainerHeight();
      this.displayTxt.text = this.GetSensorValueText();
    }
  }

  InitiateButton() {
    this.button = BABYLON.GUI.Button.CreateSimpleButton("SensorGUIButton", '');
    this.textBlock = new BABYLON.GUI.TextBlock("SensorGUITextBlock");
    this.textBlock.text = this.enable ?  'close' : 'open';
    this.button.addControl(this.textBlock);
    this.button.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_LEFT;
    this.button.verticalAlignment = BABYLON.GUI.Control.VERTICAL_ALIGNMENT_TOP;
    this.button.background = "black";
    this.button.color = "white";
    this.button.widthInPixels = 120;
    this.button.heightInPixels = 20;
    this.button.onPointerClickObservable.add(e=>{
      this.enable = !this.enable;
    })
    this.container = new BABYLON.GUI.Rectangle('SensorGUIRect')
    this.container.widthInPixels = this.containerWidth;
    this.containerCurHeight = 0;

    this.container.background = new BABYLON.Color4(0,0,0,0.3).toHexString();
    this.container.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_LEFT;
    this.container.verticalAlignment = BABYLON.GUI.Control.VERTICAL_ALIGNMENT_TOP;

    this.displayTxt = new BABYLON.GUI.TextBlock("SensorGUIDisplayText");
    this.displayTxt.color = 'white';
    this.displayTxt.fontSize = this.fontSize;
    this.displayTxt.lineSpacing = 10;
    this.displayTxt.textHorizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_LEFT;
    this.container.addControl(this.displayTxt);
    CanvasOld.main.addControl(this.button);
    CanvasOld.main.addControl(this.container);
  }

  RenderValue(key: string, value: number) {
    this.renderCollection[key] = value;
  }

  GetSensorValueText(): string {
    let context = '';
    Object.keys(this.renderCollection).map(key => {
      context += key + ": " + this.renderCollection[key] + '\n';
    })
    return context;
  }

  AdjustContainerHeight() {
    if(Object.keys(this.renderCollection).length === 0){
      this.button.color = new BABYLON.Color4(0,0,0,0).toHexString();
      this.button.background = new BABYLON.Color4(0,0,0,0).toHexString();
    }else{
      this.button.background = "black";
      this.button.color = "white";
    }
    this.container.heightInPixels = this.containerCurHeight;
    this.button.topInPixels = this.containerCurHeight;
    if(this.enable){
      this.containerCurHeight = Math.min(this.pixelPerLine * Object.keys(this.renderCollection).length, this.containerCurHeight + 4);
      this.buttonCurTop = Math.min(this.containerHeight, this.buttonCurTop + 4);
    }else{
      this.containerCurHeight = Math.max(0, this.containerCurHeight - 4);
      this.buttonCurTop = Math.max(this.buttonCurTop - 4, 0);

    }
  }

  OnDestroy()
  {
  }
}

