function GetRobot(name: string = "testRobot") {

  let robotList: RobotMoveList = new RobotMoveList();

  robotList.robot = MainGame.instance.GetOneRobot(name);
  return robotList;
}

function GetCourseName (removeSpecialCharacters : boolean = false) : string
{
  var splitUrl = window.location.href.split("/learn/");
  if (splitUrl.length <= 1)
  {
    return "ftcmovement";
  }
  //Break the URL at /learn/, then take the second part before the next slash to get the course name
  var name = splitUrl[1].split("/")[0];
  if (removeSpecialCharacters)
  {
    name = name.replace(/-/g,"")
  }
  return name;
}

function GetLevelIndex(): number {
  var phpQuery = GetPHPVariable("l");
  //Removing the potential last backslash
  var phpVar = phpQuery === undefined ? undefined : phpQuery.split('/')[0];
  return phpVar === undefined ? 0 : +phpVar;
}

function GetPHPVariable(name: string): string {
  var parts = window.location.search.substr(1).split("&");
  var $_GET = {};
  for (var i = 0; i < parts.length; i++) {
    var temp = parts[i].split("=");
    $_GET[decodeURIComponent(temp[0])] = decodeURIComponent(temp[1]);
  }
  return ($_GET[name]);
}

function GetIsChallenge(): boolean {
  if (window.location.href.includes("challenge")) {
    return true;
  }
  return false;
}

function ConvertJsonCode(text: string): object {
  return JSON.parse(text)
}

