//Convert an array into a 2D Array where each value is converted into an array with the duplicate value
//This is need for blockly
//E.g. ["leftMotor"] -> [["leftMotor", "leftMotor"]]
function ArrTo2DArr(arr: string[]): any {
    let arr2D = new Array();
    arr.forEach((n: string) => {
        let element = new Array();
        element.push(n);
        element.push(n);
        arr2D.push(element);
    });
    return arr2D;
}

