class Utility {

  public static GetServoRotation(servo: RobotServo){
    if(servo.enabled){
      return servo.GetRotation();
    }
    if(servo.GetPosition() < servo.GetTarget()){
      servo.AddPosition(servo.speed);
    }else if(servo.GetPosition() > servo.GetTarget()){
      servo.AddPosition(-servo.speed);
    }
    return servo.GetRotation();
  }

  public static CompareColor(col1: BABYLON.Color3, col2: BABYLON.Color3): boolean{
    return col1.r == col2.r && col1.g == col2.g && col1.b == col2.b;
  }

   public static ConvertRgbToHsv(r: number, g: number, b: number): BABYLON.Color3 {
    var targetColorHSV = new BABYLON.Color3(r, g, b);
    targetColorHSV = targetColorHSV.toHSV();
    return targetColorHSV;
  }

  public static GetAngle(pos1: Vector3, pos2: Vector3){
    let deltaX = pos2.x - pos1.x;
    let deltaZ = pos2.z - pos1.z;
    let theta = -Math.atan2(deltaZ, deltaX) * Mathf.Rad2Deg;
    return theta;
  }

  public static GetDistance(pos1: Vector3, pos2: Vector3){
    let deltaX = pos2.x - pos1.x;
    let deltaZ = pos2.z - pos1.z;
    let distance = Math.sqrt(Math.abs(Math.pow(deltaX, 2) + Math.pow(deltaZ, 2)));
    //Multiplied by 10 to be centimeters
    return distance * 10;
  }

  public static GetEulerAngleFromTwoVectors(pos1: Vector3, pos2: Vector3){
    let result = new Vector3(0,0,0);
    let dif = new Vector3(pos2.x - pos1.x, pos2.y - pos1.y, pos2.z - pos1.z);
    result.x = Math.atan2(dif.z, dif.x) * Mathf.Rad2Deg;
    result.y = Math.atan2(dif.y, Math.sqrt(Math.pow(dif.z, 2) + Math.pow(dif.x, 2))) * Mathf.Rad2Deg;
    return result;
  }

  /** Use to get the direction from start to end */
  public static VectorDifference(start: Vector3, end: Vector3): Vector3 {
    return new Vector3(end.x - start.x, end.y - start.y, end.z - start.z);
  }

  /** Use to get distance from 2 vectors */
  public static VectorDistance(start: Vector3, end: Vector3): number {
    const _v = this.VectorDifference(start, end);
    return Math.sqrt(Math.pow(_v.x, 2) + Math.pow(_v.y, 2) + Math.pow(_v.z, 2));
  }

  public static CreateImage(shortName: string) {
    var url = getTexture(shortName);
    var img = new BABYLON.GUI.Image(shortName, url);
    img.stretch = BABYLON.GUI.Image.STRETCH_UNIFORM;
    img.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_CENTER;

    return img;
  }

}

