class PlateColor extends MonoBehaviour {

    detectingBlock: GameObject = null;

    pressurePlateID: number;

    Start() {
        this.pressurePlateID = this.transform.GetComponentInParent(PressurePlate).id;
    }


    OnTriggerStay(other: Collider) {
        if (this.detectingBlock == null && other.GetComponentInParent(Block)) {
            this.UpdateColorAndDoors(other.GetComponentInParent(Block).color);
            this.detectingBlock = other.gameObject;
        }

    }

    OnTriggerExit(other: Collider) {
        if (other.GetComponentInParent(Block) && this.detectingBlock == other.gameObject) {
            this.UpdateColorAndDoors(BlockColor.Grey);
            this.detectingBlock = null;
        }

    }

    UpdateColorAndDoors(color: BlockColor) {
        if (color == BlockColor.Grey) {
            this.transform.GetComponentInChildren(Renderer).materialName = "Windows.mat";
        }else {
            this.transform.GetComponentInChildren(Renderer).materialName = Block.GetMaterialName(color);
        }

        VerticalDoor.allDoors.forEach(dr => {
            let door = dr.obj;
            if (door.id == this.pressurePlateID) {
                let openDoor = color == door.activationColor
                door.SwitchState(openDoor);
            }
        });

    }

    public GetColor() {
        if (this.detectingBlock != null) {
            return this.detectingBlock.GetComponent(Block).color;
        }
        return BlockColor.Grey;
    }
}

