class Block extends MonoBehaviour {
    @SerializeEnumField(BlockColor)
    color: BlockColor = BlockColor.Grey;

    public static GetMaterialName(col: BlockColor) {
        switch (col) {
            case BlockColor.Red:
                return "red_block.mat";
                break;
            case BlockColor.Yellow:
                return "yellow_block.mat";
                break;
            case BlockColor.Blue:
                return "blue_block.mat";
                break;
        }
        return "pressure_plate_default.mat";
    }

    Start() {
        // set material accoording to block color 
        this.transform.GetComponentsInChildren(Renderer).forEach(obj => {
            obj.materialName = Block.GetMaterialName(this.color);
        });
    }
