    }

    for (let i = 0; i < VerticalDoor.allDoors.length; i++) {
      let door = VerticalDoor.allDoors[i];
      if (door.id == me.id) {
        VerticalDoor.allDoors[i] = me;
        return;
      }
    }
    VerticalDoor.allDoors.push(me);
  }

  Start() {
    this.door = this.transform.Find("Door").gameObject;

    this.targetY = this.door.transform.position.y;

    this.SetColor();
  }

  FixedUpdate() {

    let pos = this.door.transform.position;
    if (this.door.transform.position.y != this.targetY) {
      this.door.transform.position = new Vector3(pos.x, Mathf.MoveTowards(pos.y, this.targetY, this.openingSpeed), pos.z);
    }
  }

  SetColor() {
    switch (this.activationColor) {
      case BlockColor.Yellow:
        this.door.GetComponent(Renderer).materialName = "yellow_block.mat";
        break;
      case BlockColor.Blue:
        this.door.GetComponent(Renderer).materialName = "blue_block.mat";
        break;
    }
  }

  SwitchState(open: boolean) {
    this.targetY = (open) ? -Math.abs(this.targetY) : Math.abs(this.targetY);
  }

  Disable() {
    VerticalDoor.allDoors.forEach(d => {
      Destroy(d.obj);
    });

    VerticalDoor.allDoors = new Array();
  }

}

