//GrabbyButton.ts

enum ButtonColor {
  Purple,
  Orange,
  Green,
  Grey
}


class GrabbyButton extends MonoBehaviour {


  static allButtons = new Array();

  // the color read by the Color Sensor
  sensorColor: BABYLON.Color3;

  // the ID will link the button to a horizontal door 
  @SerializeField
  id: number = 0;

  pressed: boolean = false;

  color: ButtonColor = ButtonColor.Grey;

  public static GetMaterialName(col: ButtonColor) {
    switch (col) {
      case ButtonColor.Purple:
        return "button_color_purple.mat";
        break;
      case ButtonColor.Orange:
        return "button_color_orange.mat";
        break;
      case ButtonColor.Green:
        return "button_color_green.mat";
        break;
    }
    return "button_color_default.mat";
  }


  Awake() {
    this.AddButtonToList();
  }

  Start() {
    this.SetSensorColor();
  }

  AddButtonToList() {
    let me = {
      obj: this,
      id: this.transform.uniqueId
    }

    for (let i = 0; i < GrabbyButton.allButtons.length; i++) {
      let button = GrabbyButton.allButtons[i];
      if (button.id == me.id) {
        GrabbyButton.allButtons[i] = me;
        return;
      }
    }
    GrabbyButton.allButtons.push(me);
  }

  public PressButton() {
    this.pressed = true;

    this.RandomizeButtonColor();

    this.UpdateDoors();
  }

  UpdateDoors() {
    // counting how many buttons have the same color (having the same id)
    let buttonsColors = new Array();
    // counting how many buttons are there (having the same id)
    let totalButtons = 0;
    GrabbyButton.allButtons.forEach(btn => {
      let button = btn.obj;
      if (button.id == this.id) {
        totalButtons++;
        buttonsColors.push(button.color);
      }
    });

    let buttonsPressed = this.GetNumberOfMostRepeatedColor(buttonsColors);

    // updating doors
    // calculating how much the door should be open (accoording to the number of buttons pressed and
    // their colors)
    // the gap is going to be a number between 0 and 1 (0 = open   1 = closed)
    let pressed = buttonsPressed / totalButtons;
    let doorGapSize = 1 - ((pressed == 1) ? pressed : pressed * 0.5);

    HorizontalDoor.allDoors.forEach(dr => {
      let door = dr.obj;
      if (door.id == this.id) {
        door.SetGap(doorGapSize);
      }
    });
  }

  RandomizeButtonColor() {
    let matName = "";

    // getting a random color (different than the one i have now)
    let randomColor = this.color;
    do {
      randomColor = Random.Range(0, 3, true);
    } while (randomColor == this.color);

    let materialName = GrabbyButton.GetMaterialName(randomColor);
    let material = Material.Get(materialName);

    this.transform.Find("ColorSurface").GetComponent(Renderer).SetMaterial(material);
    this.color = randomColor;

    this.SetSensorColor();
  }

  SetSensorColor() {
    let material = this.transform.Find("ColorSurface").GetComponent(Renderer).material;

    this.sensorColor = new BABYLON.Color3(this.Round(material.mainColor.r), this.Round(material.mainColor.g), this.Round(material.mainColor.b));
  }

  GetNumberOfMostRepeatedColor(buttonsColors) {
    // gets the array, counts how many times each color shows and return the largest value


    // counting all colors
    let colors = [0, 0, 0]
    buttonsColors.forEach(color => {
      if (color != ButtonColor.Grey) {
        colors[color]++;
      }
    });

    // getting most counted color
    let largestValue = Math.max(colors[0], colors[1], colors[2]);

    return largestValue;
  }

  Disable() {
    GrabbyButton.allButtons.forEach(b => {
      Destroy(b.obj);
    });

    GrabbyButton.allButtons = new Array();
  }

  Round(num){
    // this function will round to max 2 decimals
    // 1.5684 = 1.57
    return Math.round((num + Number.EPSILON) * 100) / 100
  }

}

