//Button.ts

class RedButton extends MonoBehaviour {

    pressSpeed: number = 0.15;

    defaultScaleZ: number;
    defaultPositionZ : number;

    @SerializeField
    id: number;

    // How long the button takes to go back to the "pressable" state (start counting after fully pressed)
    recoverSpeed: number = 0.005;

    recovering: boolean = false

    Start() {
        this.defaultScaleZ = this.transform.localScale.z;
        this.defaultPositionZ = this.transform.localPosition.z;
    }

    FixedUpdate() {
        let pressed = this.GetComponentInParent(GrabbyButton).pressed;
        let scale = this.transform.localScale;
        let pos = this.transform.localPosition;
        let zAdjustment = this.defaultScaleZ - scale.z

        if (pressed) {
            if (!this.recovering) {
                let sizeToGo = this.defaultScaleZ / 10;
                if (scale.z > sizeToGo) {
                    // if it has been pressed
                    this.transform.localScale = new Vector3(scale.x, scale.y, Mathf.MoveTowards(scale.z, sizeToGo,  this.pressSpeed));
                    this.transform.localPosition = new Vector3(pos.x, pos.y, this.defaultPositionZ - zAdjustment);
                } else {
                    this.recovering = true;
                }

            } else {
                if (scale.z < this.defaultScaleZ) {
                    // recovering 
                    this.transform.localScale = new Vector3(scale.x, scale.y, Mathf.MoveTowards(scale.z, this.defaultScaleZ,  this.recoverSpeed));
                    this.transform.localPosition = new Vector3(pos.x, pos.y, this.defaultPositionZ - zAdjustment)
                } else {
                    this.GetComponentInParent(GrabbyButton).pressed = false;
                    this.recovering = false;
                }
            }
        }
    }

    OnTriggerEnter(other: Collider) {
        if (other.GetComponentInParent(GrabbyArm) && !this.GetComponentInParent(GrabbyButton).pressed) {
            this.GetComponentInParent(GrabbyButton).PressButton();
        }
    }
}

