//HorizontalDoor.ts

class HorizontalDoor extends MonoBehaviour {
  static allDoors = new Array();

  // the ID will link the door to buttons 
  @SerializeField
  id: number = 0;

  doorsGap: number = 1;

  doorSize: number;

  doorSpeed: number = 0.05;

  doors = new Array();
  defaultDoorsX = new Array();

  doorCollider: GameObject;

  colliderEnabled: boolean;

  Awake() {
    this.AddDoorToList();
  }

  AddDoorToList() {
    let me = {
      obj: this,
      id: this.transform.uniqueId
    }

    for (let i = 0; i < HorizontalDoor.allDoors.length; i++) {
      let door = HorizontalDoor.allDoors[i];
      if (door.id == me.id) {
        HorizontalDoor.allDoors[i] = me;
        return;
      }
    }
    HorizontalDoor.allDoors.push(me);
  }

  Start() {
    this.doors.push(this.transform.Find("LeftDoor"))
    this.doors.push(this.transform.Find("RightDoor"))

    this.doorSize = this.doors[0].transform.localScale.x;

    this.defaultDoorsX.push(this.doors[0].transform.localPosition.x);
    this.defaultDoorsX.push(this.doors[1].transform.localPosition.x);

    this.colliderEnabled = true;

    this.doorCollider = this.transform.Find("DoorCollider");
  }

  FixedUpdate() {
    let doorOpen = false;
    for (let i = 0; i < 2; i++) {
      // what side this door is going to slide to
      let side = (i == 0) ? -1 : 1;
      let scale = this.doors[i].transform.localScale;
      let pos = this.doors[i].transform.localPosition;
      let xAdjustment = (this.doorSize - scale.x) / 2

      this.doors[i].transform.localScale = new Vector3(Mathf.MoveTowards(scale.x, this.doorSize * this.doorsGap, this.doorSpeed), scale.y, scale.z);
      this.doors[i].transform.localPosition = new Vector3(this.defaultDoorsX[i] - (xAdjustment * side), pos.y, pos.z);

      if (this.doors[i].transform.localScale.x == 0) {
        doorOpen = true;
      }
    }

    // disabling colliders if door is open
    if (doorOpen && this.colliderEnabled) {
      this.doorCollider.gameObject.SetActive(false);
      this.colliderEnabled = false;
    } else if (!doorOpen && !this.colliderEnabled) {
      this.doorCollider.gameObject.SetActive(true);
      this.colliderEnabled = true;
    }

    // let pos = this.transform.position;
    //   let colScale = this.doorCollider.transform.localScale;
    //   this.doorCollider.transform.position = new Vector3(pos.x - colScale.x, pos.y, pos.z)


    // if(Input.GetKeyDown(KeyCode.End)){
    //   SceneManager.ReloadCurrentScene();
    // }
  }

  SetGap(gapSize: number) {
    this.doorsGap = gapSize;
    // here, doorsGap = 1 -> door closed
    //       doorsGap = 0 -> door open
  }

  Disable() {
    HorizontalDoor.allDoors.forEach(d => {
      Destroy(d.obj);
    });

    HorizontalDoor.allDoors = new Array();
  }

}
